// ============================================
// INITIALIZE ON PAGE LOAD
// ============================================

window.addEventListener('DOMContentLoaded', function() {
    const today = new Date();
    const formattedDate = today.toLocaleDateString('en-IN', { 
        day: '2-digit', 
        month: 'short', 
        year: 'numeric' 
    });

    const logoImgEl = document.getElementById('logoImage');
    const qrInEl = document.getElementById('qrImageInstagram');
    const qrYtEl = document.getElementById('qrImageYouTube');

    [logoImgEl, qrInEl, qrYtEl].forEach(imgEl => {
        if (imgEl) imgEl.crossOrigin = 'anonymous';
    });
    
    document.getElementById('qrImageInstagram').src = IMAGES.qrInstagram;
    document.getElementById('bookingDate').textContent = formattedDate;
    
    const dateInput = document.getElementById('eventDate');
    dateInput.valueAsDate = today;
    
    generateBookingID();
});

// ============================================
// GENERATE UNIQUE BOOKING ID
// ============================================

function generateBookingID() {
    const date = new Date();
    const year = date.getFullYear();
    const month = String(date.getMonth() + 1).padStart(2, '0');
    const day = String(date.getDate()).padStart(2, '0');
    const random = Math.floor(Math.random() * 10000).toString().padStart(4, '0');
    
    const bookingID = `CD${year}${month}${day}${random}`;
    document.getElementById('bookingId').textContent = bookingID;
    return bookingID;
}

// ============================================
// GENERATE INVOICE PREVIEW
// ============================================

function generateInvoice() {
    // Validate required fields
    const customerName = document.getElementById('customerName').value.trim();
    const customerAddress = document.getElementById('customerAddress').value.trim();
    const customerPhone = document.getElementById('customerPhone').value.trim();
    const eventDate = document.getElementById('eventDate').value;
    const totalCost = document.getElementById('totalCost').value;
    
    if (!customerName || !customerAddress || !customerPhone || !eventDate || !totalCost || totalCost <= 0) {
        alert(' Please fill in all required fields:\n- Customer Name\n- Address\n- Phone Number\n- Event Date\n- Total Cost');
        return;
    }
    
    // Set images
    document.getElementById('logoImage').src = IMAGES.logo;
    document.getElementById('qrImageInstagram').src = IMAGES.qrInstagram;
    document.getElementById('qrImageYouTube').src = IMAGES.qrYouTube;
    
    // Set contact details
    document.getElementById('phoneNumber').textContent = CONFIG.phone;
    document.getElementById('whatsappNumber').textContent = CONFIG.whatsapp;
    document.getElementById('youtubeChannel').textContent = CONFIG.youtube;
    
    // Customer Details
    document.getElementById('displayName').textContent = customerName;
    document.getElementById('displayAddress').textContent = customerAddress;
    document.getElementById('displayPhone').textContent = customerPhone;
    
    const eventDateObj = new Date(eventDate);
    const formattedEventDate = eventDateObj.toLocaleDateString('en-IN', {
        day: '2-digit',
        month: 'short',
        year: 'numeric'
    });
    document.getElementById('displayEventDate').textContent = formattedEventDate;
    
    // Design Coverage - Show ALL options with checked/unchecked
    const allDesignOptions = ['Fingers', 'Palm', 'Wrist', 'Forearm', 'Elbow', 'Back Hand', 'Full Hand', 'Toes', 'Ankle', 'Feet', 'Full Feet', 'Knee', 'Knee Length'];
    const designCheckboxes = document.querySelectorAll('.form-section:nth-child(2) .checkbox:checked');
    const selectedDesigns = Array.from(designCheckboxes).map(cb => cb.value);
    
    const designCoverageHTML = allDesignOptions.map(option => {
        const isChecked = selectedDesigns.includes(option);
        return `<div class="checkbox-display-item ${isChecked ? 'checked' : ''}">
            <span class="check-icon">${isChecked ? '' : ''}</span>
            <span>${option}</span>
        </div>`;
    }).join('');
    
    document.getElementById('displayDesignCoverage').innerHTML = designCoverageHTML;
    
    const selectedDesign = document.getElementById('selectedDesign').value.trim();
    if (selectedDesign) {
        document.getElementById('displayDesignCodeRow').style.display = 'flex';
        document.getElementById('displayDesignCode').textContent = selectedDesign;
    } else {
        document.getElementById('displayDesignCodeRow').style.display = 'none';
    }
    
    // Occasion Type - Show ALL options with checked/unchecked
    const allOccasionOptions = ['Bridal', 'Non-Bridal', 'Festival', 'Baby Shower', 'Party', 'Other'];
    const occasionCheckboxes = document.querySelectorAll('.form-section:nth-child(3) .checkbox:checked');
    const selectedOccasions = Array.from(occasionCheckboxes).map(cb => cb.value);
    
    const occasionHTML = allOccasionOptions.map(option => {
        const isChecked = selectedOccasions.includes(option);
        return `<div class="checkbox-display-item ${isChecked ? 'checked' : ''}">
            <span class="check-icon">${isChecked ? '' : ''}</span>
            <span>${option}</span>
        </div>`;
    }).join('');
    
    document.getElementById('displayOccasion').innerHTML = occasionHTML;
    
    // Event Details
    const eventTime = document.getElementById('eventTime').value;
    const totalMembers = document.getElementById('totalMembers').value;
    
    if (eventTime) {
        document.getElementById('displayTimeRow').style.display = 'flex';
        document.getElementById('displayTime').textContent = eventTime;
    } else {
        document.getElementById('displayTimeRow').style.display = 'none';
    }
    
    if (totalMembers && totalMembers > 0) {
        document.getElementById('displayMembersRow').style.display = 'flex';
        document.getElementById('displayMembers').textContent = totalMembers;
    } else {
        document.getElementById('displayMembersRow').style.display = 'none';
    }
    
    // Hide event details section if both are empty
    if (!eventTime && (!totalMembers || totalMembers <= 0)) {
        document.getElementById('eventDetailsSection').style.display = 'none';
    } else {
        document.getElementById('eventDetailsSection').style.display = 'block';
    }
    
    // Payment Calculation
    const cost = parseFloat(totalCost);
    const applyDiscount = document.getElementById('firstOrderDiscount').checked;
    
    const discountInput = parseFloat(document.getElementById('discountAmount').value) || 0;
    const discount = applyDiscount ? discountInput : 0;
    const subtotal = cost - discount;
    const advance = subtotal * 0.20;
    const balance = subtotal - advance;
    
    document.getElementById('displayTotalCost').textContent = ` ${cost.toLocaleString('en-IN')}`;
    document.getElementById('displayDiscount').textContent = `-  ${discount.toLocaleString('en-IN')}`;
    document.getElementById('displaySubtotal').textContent = ` ${subtotal.toLocaleString('en-IN')}`;
    document.getElementById('displayAdvance').textContent = ` ${advance.toLocaleString('en-IN')}`;
    document.getElementById('displayAdvancePaid').textContent = ` ${advance.toLocaleString('en-IN')}`;
    document.getElementById('displayBalance').textContent = ` ${balance.toLocaleString('en-IN')}`;
    
    // Show/hide discount row
    if (applyDiscount) {
        document.getElementById('discountRowDisplay').style.display = 'flex';
    } else {
        document.getElementById('discountRowDisplay').style.display = 'none';
    }
    
    // Show fully paid badge if balance is 0
    if (balance === 0 && cost > 0) {
        document.getElementById('fullyPaidBadge').style.display = 'block';
    } else {
        document.getElementById('fullyPaidBadge').style.display = 'none';
    }
    
    // Switch to invoice view
    document.getElementById('formSection').style.display = 'none';
    document.getElementById('invoiceSection').style.display = 'block';
    
    // Scroll to top
    window.scrollTo(0, 0);
    
    showNotification(' Invoice Generated Successfully!', 'success');
}

